INSERT INTO `product` VALUES (16,'Loose Fit','loose-fit','Heavyweight cotton jersey T-shirt with a graphic front, round neck, ribbed hem and low-cut shoulders. Side slits on each side. Slightly longer in the back. Loose fit for comfort without being baggy.',449000,749000,0,1,'2025-04-14 17:00:00.000000','products/1.jpg','2025-04-21 02:49:59.503784','2025-04-21 02:49:59.477938',1),(17,'Oversized Fit','oversized-fit','Heavyweight cotton jersey t-shirt with round neck, ribbed hem, low-cut shoulders and horizontal hem. Loose fit for a very loose baggy fit.',499000,799000,0,1,'2025-04-14 17:00:00.000000','products/4.jpg','2025-04-21 02:55:32.127522','2025-04-21 02:55:32.103639',1),(18,'Printed T-shirt','printed-t-shirt','Soft, printed cotton jersey T-shirt with off-shoulder ruffles and a crew neck with a tapered hem. Loose fit for comfort without being baggy.',399000,699000,0,1,'2025-04-14 17:00:00.000000','products/6.jpg','2025-04-21 03:02:57.532330','2025-04-21 03:02:57.512075',2),(19,'Printed T-shirt Zeppelin','printed-t-shirt-zeppelin','Heavyweight printed cotton jersey T-shirt with ribbed collar, low-cut shoulders and horizontal hem. Loose fit for comfort without being baggy.',249000,549000,0,1,'2025-04-14 17:00:00.000000','products/10.jpg','2025-04-21 03:08:06.542238','2025-04-21 03:08:06.527399',1),(20,'COOLMAX T-Shirt','coolmax-t-shirt','Lightweight jersey T-shirt with a crew neck, ribbed hem and horizontal hem. Fitted for comfort and a classic look. T-shirt incorporates COOLMAX® performance fabric - a unique form of polyester that is soft, comfortable and quick-drying, wicking moisture and regulating temperature.',349000,599000,0,1,'2025-04-14 17:00:00.000000','products/13.jpg','2025-04-21 03:11:25.275587','2025-04-21 03:11:25.264076',1),(21,'Linen-blend polo shirt','linen-blend-polo-shirt','Polo shirt made from a linen blend with a textured knit, featuring a collar, front V-opening, and short sleeves. Regular fit for comfortable wear and a classic silhouette.',