neck and ribbed hem. Slightly longer back. Four-way stretch for maximum comfort and ease of movement.',249000,499000,0,1,'2025-04-14 17:00:00.000000','products/52.jpg','2025-04-21 04:07:27.444457','2025-04-21 04:07:27.431588',2),(33,'Knit tank top','knit-tank-top','Soft ribbed knit tank made of cotton blend with a crew neck and horizontal flap. Fitted for a relaxed fit and classic silhouette.',499000,799000,0,1,'2025-04-14 17:00:00.000000','products/55.jpg','2025-04-21 04:09:33.146367','2025-04-21 04:09:33.129435',2),(34,'Perforated tank top','perforated-tank-top','Perforated cotton blend tank with a crew neck and horizontal flap. Fitted for a relaxed fit and classic silhouette.',799000,999000,0,1,'2025-04-14 17:00:00.000000','products/58.jpg','2025-04-21 04:11:41.446931','2025-04-21 04:11:41.424139',2),(35,'Faded tank top','faded-tank-top','Lightweight cotton jersey tank in faded style with a crew neck and ribbed hem, deep armholes with raw edges and horizontal flap. Fitted for a relaxed fit and classic silhouette.',399000,699000,0,1,'2025-04-14 17:00:00.000000','products/60.jpg','2025-04-21 04:15:36.359272','2025-04-21 04:15:36.344380',1),(36,'Sleeveless hoodie','sleeveless-hoodie','Sleeveless sports hoodie in functional fabric made with DryMove™ that wicks moisture away from your skin to keep you dry and comfortable as you move. Fitted with a drawstring hood, mesh lining and horizontal flaps with side slits.',499000,799000,0,1,'2025-04-14 17:00:00.000000','products/62.jpg','2025-04-21 04:17:04.553315','2025-04-21 04:17:04.535438',1),(37,'Zip-up hoodie','zip-up-hoodie','Lightweight fleece zip-up hoodie made of a cotton blend with a soft brushed back. Jersey-lined hood with drawstring, zip-up front, side slash pockets with hem and cuffs and a wide ribbed hem. Loose fit for a relaxed fit without sagginess.',699000,999000,0,1,'2025-04-14 17:00:00.000000','products/66.jpg','2025-04-21 04:19:25.129869','2025-04-21 04:19:25.114704',1),(38,'Graphic hoodie','graphic-hoodie','Heavyweight fleece hoodie made of a cotton blend with a soft brushed back and a printed pattern. Double-layer hood, low-cut shoulders and long sleeves. Kangaroo pockets, ribbed cuffs and hem. Loose fit for a relaxed fit without sagginess.',749000,999000,0,1,'2025-04-14 17:00:00.000000','products/72.jpg','2025-04-21 04:23:56.426649','2025-04-21 04:23:56.407702',1),(39,'Loose Fit hoodie','loose-fit-hoodie','Heavyweight fleece hoodie made of a cotton blend with a soft brushed back. Jersey-lined hood with drawstring, low-cut shoulders, long sleeves, kangaroo pockets and a wide ribbed hem and cuffs. Loose fit for comfort without being baggy.',499000,799000,0,1,'2025-04-14 17:00:00.000000','products/76.jpg','2025-04-21 04:27:41.511727','2025-04-21 04:27:41.498266',1),(40,'Regular Fit hoodie','regular-fit-hoodie','Lightweight fleece with soft brushed back. Double-layered hood, drawstring, kangaroo pocket and wide ribbed cuffs and hem. Fitted for comfort and classic style.',499000,799000,0,1,'2025-04-14 17:00:00.000000','products/82.jpg','2025-04-21 04:30:58.162860','2025-04-21 04:30:58.144066',1),(41,'Parka jacket','parka-jacket','Water-resistant and windproof nylon parka with stand-up collar and a hidden hood that can be easily removed. Zip and windscreen with hidden snaps down the front, front shoulder pads and long sleeves with snaps at the cuffs. Zip front pockets, front flap pockets with hidden snaps and one inside pocket with snaps. Fitted for comfort and a classic look. Lined.',1499000,1799000,0,1,'2025-04-14 17:00:00.000000','products/86.jpg','2025-04-21 04:34:35.045758','2025-04-21 04:34:35.034980',1),(42,'Worker denim jacket','worker-denim-jacket','Stiff cotton denim jacket with collar, zip down the front, rear shoulder pads, side pockets and a breast pocket with hidden snap flaps. Long sleeves, button-fastening cuffs and adjustable belt and buttons at the sides. Straight hem. Loose fit for comfort without being baggy.',1499000,1799000,0,1,'2025-04-14 17:00:00.000000','products/88.jpg','2025-04-21 04:36:00.938339','2025-04-21 04:36:00.924424',1),(43,'Padded fabric jacket','padded-fabric-jacket','Single-breasted cotton raglan jacket with V-lapel and three buttons down the front. Flap-seamed front pockets and three inside pockets. Decorative buttons at the cuffs and single side slit. Fitted for comfort and a classic look. Lined.',1799000,1999000,0,1,'2025-04-14 17:00:00.000000','products/90.jpg','2025-04-21 04:37:40.550143','2025-04-21 04:37:40.541421',1),(44,'Canvas jacket','canvas-jacket','Cotton canvas coach jacket with collar, snap fastening down front, long sleeves, split welt pockets at front and one inside pocket. Elasticated cuffs and drawstring at hem. Fitted for comfort and classic style. Lined. Lightweight woven cotton and linen blend shirt jacket with collar, zip fastening down front and shoulder pads at back. Side seam pockets, flap chest pocket and inside pocket. Long sleeves with slit cuffs and buttons. Lined. Cotton linen blend combines the softness of cotton with the durability of linen, creating a beautiful, textured fabric that breathes and drapes perfectly.',1299000,1599000,0,1,'2025-04-14 17:00:00.000000','products/92.jpg','2025-04-21 04:39:20.205828','2025-04-21 04:39:20.191340',1),(45,'Linen-blend jacket','linen-blend-jacket','Lightweight woven cotton and linen blend shirt with collar, zip fastening down front and shoulder pads at back. Side seam pockets, flap chest pocket and inside pocket. Long sleeves with slit and button cuffs. Lining. Cotton and linen blend combines the softness of cotton with the durability of linen, creating a beautiful, textured fabric that breathes and drapes perfectly.',1399000,1799000,0,1,'2025-04-14 17:00:00.000000','products/94.jpg','2025-04-21 04:40:39.166759','2025-04-21 04:40:39.154215',2),(46,'Loose jeans','loose-jeans','5-pocket jeans in sturdy cotton denim with a rounded leg and a loose fit from hip to hem with a full leg opening. Regular waistband and zip fastene